$(".number-cell2").click(function(){
  $(".show-number-show").css("display","inline-block");
  $(".show-number-show").css("opacity","1");
  $(".show-number-hide").css("display","none");
  $(".top-whatsapp-icon").css("right","130px")
});

$(".number-cell-form2").click(function(){
  $(this).text(function(b,a){
    return a==="+1 (908) 674-2809"?"+1 (908) 674-2809":"+1 (908) 674-2809"
  })
});

$(".number-cell-footer2").click(function(){
  $(this).text(function(b,a){
    return a==="+1 (908) 674-2809"?"+1 (908) 674-2809":"+1 (908) 674-2809"
  })
});

$(".number-fixo-footer2").click(function(){
  $(this).text(function(b,a){
    return a==="N.A."?"N.A.8":"N.A"
  })
});

$(function(){
  $("#maximage").maximage({
    cycleOptions:{
      fx:"fade",
      speed:1000,
      timeout:3000,
      prev:"#arrow_left",
      next:"#arrow_right",
    },
    onFirstImageLoaded:function(){
      jQuery("#cycle-loader").hide();
      jQuery("#maximage").fadeIn("fast")
    }
  });
  jQuery(".in-slide-content").delay(400).fadeIn()
});

$(function(){
  $("a.page-scroll").bind("click",function(b){
    var a=$(this);
    $("html, body").stop().animate({scrollTop:$(a.attr("href")).offset().top},1500,"easeInOutExpo");
    b.preventDefault()
  })
});


